webpackJsonp([0xa5725c1c8920],{7513:function(t,e){t.exports={data:{post:{html:'<p><a href="http://www.flickr.com/photos/papascott/83519531/" title="Photo Sharing"><img src="http://static.flickr.com/38/83519531_2af74dcf77.jpg" width="500" height="375" alt="IMG_0511" /></a></p>\n<p>In the spirit of ecological renewal, we have returned our <a href="http://www.papascott.de/archives/2005/12/25/christmas-traditions/">Christmas tree</a> to mother nature and have planted it in our backyard, to once again contribute precious oxygen to our earth\'s atmosphere.</p>\n<p>Perhaps, though, we should have thought of that <em>before</em> we bought a chopped tree.</p>',fields:{title:"Knut",date:"07 Jan 2006",url:"https://papascott.de/2006-01-07-knut/"}}},pathContext:{slug:"/2006-01-07-knut/",prev:{fields:{title:"Outage Resolved",date:"05 Jan 2006",slug:"/2006-01-05-outage-resolved/"}},next:{fields:{title:"The Hammer",date:"07 Jan 2006",slug:"/2006-01-07-the-hammer/"}}}}}});
